import React from 'react';
import QuestionList from './QuestionList'


class App extends React.Component {
  getScore = (score) => {
    console.log(score);
  }

  render(){
    return (
      <div>
        <h1>Lutrivia</h1>
        <QuestionList onQuestionList={this.getScore}/>
        <div>
          <form onSubmit={this.getScore} className="NameForm" >
            <input type="text" name="name" placeholder="Name"/>
            <input type="submit" name="" value="Sbumit score"/>
          </form>
        </div>
      </div>
    )
  }
}

export default App;
